    foreach (sfMixer::getCallables('BaseCobrosPeer:doSelectJoin:doSelectJoin') as $callable)
    {
      call_user_func($callable, 'BaseCobrosPeer', $c, $con);
    }


		$c = clone $c;

		// Set the correct dbName if it has not been overridden
		if ($c->getDbName() == Propel::getDefaultDB()) {
			$c->setDbName(self::DATABASE_NAME);
		}

		CobrosPeer::addSelectColumns($c);
		$startcol = (CobrosPeer::NUM_COLUMNS - CobrosPeer::NUM_LAZY_LOAD_COLUMNS);
		ClientesPeer::addSelectColumns($c);

		$c->addJoin(array(CobrosPeer::CO_CLI,), array(ClientesPeer::CO_CLI,), $join_behavior);
		$stmt = BasePeer::doSelect($c, $con);
		$results = array();

		while ($row = $stmt->fetch(PDO::FETCH_NUM)) {
			$key1 = CobrosPeer::getPrimaryKeyHashFromRow($row, 0);
			if (null !== ($obj1 = CobrosPeer::getInstanceFromPool($key1))) {
				// We no longer rehydrate the object, since this can cause data loss.
				// See http://propel.phpdb.org/trac/ticket/509
